import React , { useEffect , useState } from "react";

function Test () {

	const [ elLibro , setElLibro ] = useState();

	useEffect(() => {
		const api = "https://www.googleapis.com/books/v1/volumes?q=papelucho";
		
		fetch( api )
		.then( libro => libro.json() )
		.then( libro => {
			console.log( libro );
			console.log( libro.items[ 0 ].volumeInfo.title );
			
			var todo = [];
			
			for ( var count = 0; count <= libro.items.length-1; count++ ) {
				console.log( libro.items[ count ].volumeInfo.title );
				var getLibro = {
					"nombre" : libro.items[ count ].volumeInfo.title ,
				};
				todo.push({ "nombre" : getLibro.nombre });
			};
			
			setElLibro( todo );
		});
		
	},[]);
	

	return (
		<section className="test">
			<h2>Libros</h2>
			{
				elLibro.map( ( librito ) => {
					return (
						<div className="libro">{ librito?.nombre }</div>
					);
				})
			}
		</section>
	);
};

export default Test;
